tables.table_schema:
CREATE TABLE quantum_circuits (
    circuit_id UUID PRIMARY KEY,
    circuit_name VARCHAR(255) NOT NULL,
    circuit_description TEXT
);

CREATE TABLE quantum_circuit_parameters (
    circuit_id INT PRIMARY KEY,
    circuit_name TEXT NOT NULL,
    parameter_data JSONB
);

CREATE TABLE machine_learning_models (
    model_id INT PRIMARY KEY,
    model_name TEXT NOT NULL,
    model_description TEXT,
    model_parameters JSONB
);

CREATE TABLE training_data (
    data_id INT PRIMARY KEY,
    circuit_id INT REFERENCES quantum_circuit_parameters(circuit_id),
    model_id INT REFERENCES machine_learning_models(model_id),
    training_data JSONB
);

CREATE TABLE quantum_circuits (
 circuit_id SERIAL PRIMARY KEY,
 circuit_name VARCHAR(255),
 parameters JSON
);

CREATE TABLE quantum_models (
 model_id SERIAL PRIMARY KEY,
 model_name VARCHAR(255),
 circuit_id INT,
 FOREIGN KEY (circuit_id) REFERENCES quantum_circuits(circuit_id)
);

CREATE TABLE quantum_circuits (
    circuit_id INT PRIMARY KEY,
    circuit_name VARCHAR(50) NOT NULL,
    num_qubits INT NOT NULL,
    gate_operations TEXT[]
);

CREATE TABLE circuit_parameters (
    parameter_id INT PRIMARY KEY,
    circuit_id INT REFERENCES quantum_circuits(circuit_id),
    parameter_name VARCHAR(50) NOT NULL,
    parameter_value FLOAT NOT NULL
);

CREATE TABLE training_data (
    data_id INT PRIMARY KEY,
    circuit_id INT REFERENCES quantum_circuits(circuit_id),
    input_data JSONB NOT NULL,
    output_data JSONB NOT NULL
);

CREATE TABLE model_parameters (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(50) UNIQUE NOT NULL,
    hyperparameters JSONB NOT NULL
);

CREATE TABLE model_performance (
    performance_id INT PRIMARY KEY,
    model_id INT REFERENCES model_parameters(model_id),
    accuracy FLOAT NOT NULL,
    loss FLOAT NOT NULL
);
